import React from "react";
import { View, Image, StyleSheet, Dimensions } from "react-native";
import globalStyles from "../../../constants/global.styles";

const PhotosSection = ({ images }) => {
  return (
    <View style={[globalStyles.rowStart, styles.container]}>
      {images.map((image) => (
        <View style={styles.imageContainer}>
          <Image source={image} style={styles.image} />
        </View>
      ))}
      <View style={styles.viewMore}>6+</View>
    </View>
  );
};

export default PhotosSection;

const styles = StyleSheet.create({
  container: {
    padding: 20,
  },
  imageContainer: { marginRight: 10 },
  image: {
    width: Dimensions.get("window").width / 4 - 20,
    height: Dimensions.get("window").width / 4 - 20,
    resizeMode: "contain",
  },
  viewMore: { width: 30, height: 30, backgroundColor: colors.primary },
});
